import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './HomePage';
import UserList from './UserList';
import LoginPage from './LoginPage';
import CustomNavbar from './Navbar'; // Importando a Navbar
import PrivateRoute from './PrivateRoute'; // Importando o PrivateRoute
import ListTrainers from './components/ListTrainers'; // Importando o ListTrainers

const App = () => {
  return (
    <Router>
      <CustomNavbar /> {/* Navbar aparece em todas as páginas */}

      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />

        {/* Proteger a rota de usuários com PrivateRoute */}
        <Route
          path="/users"
          element={
            <PrivateRoute>
              <UserList />
            </PrivateRoute>
          }
        />

        {/* Nova rota para listar treinadores */}
        <Route
          path="/trainers"
          element={
            <PrivateRoute>
              <ListTrainers />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
